//SPDX-License-Identifier:MIT
pragma solidity^0.8.0;

contract Buyer {

uint public rice = 10;
bool public isSold;

function price() external view returns(uint){
    return rice;
}

function setPrice() external view returns(uint){
    return rice;
}

function dcallhim() public {
    address _his = 0x9220C103e65B873E5DB7341a32899eC27Ee11f6B;
    _his.delegatecall(abi.encodeWithSignature('buy()'));
}

function callhim() public {
    address _his = 0x9220C103e65B873E5DB7341a32899eC27Ee11f6B;
    _his.call{gas:7900000}(abi.encodeWithSignature('buy()'));
}

}

